import { LoginBox, MainMenuBox, MenuButton } from "../styles/Menu";
import { MenuButtonY } from "./buttons/MenuButtonsY";

export const MenuHidden = ({ isOpen, setIsOpen }: any) => {
  return (
    <MainMenuBox onChange={() => setIsOpen(!isOpen)}>
      <MenuButtonY />
      <MenuButtonY />
      <MenuButtonY />
      <LoginBox theme={isOpen}></LoginBox>
    </MainMenuBox>
  );
};
